-- =============================================== ZABD ======================================================
  DROP TABLE IF EXISTS tb_zabd;
CREATE TABLE `tb_zabd` (
  `id` INT PRIMARY KEY NOT NULL AUTO_INCREMENT COMMENT 'ID DE INDENTIFICACION',
  `cod_zabd` CHAR(8) COMMENT 'CODIGO ZABD',
  `nombre` VARCHAR (50) COMMENT 'NOMBRE DE LA ZABD',
  `resolucion` VARCHAR(50) COMMENT 'NUMERO DE RESOLUCIÓN DE LA ZABD',
  `doc_resolucion` VARCHAR(30) COMMENT 'DOCUMENTO ADJUNTO DE LA  RESOLUCION DE LA ZABD',
  `fec_reconocimiento` DATE COMMENT 'FECHA DE RECONOCIMIENTO DE LA ZABD',
  `ubigeo_id` INT(10) COMMENT 'LUGAR DONDE SE UBICA LA ZABD',
  `area` FLOAT COMMENT 'AREA(ha) DE LA ZABD',
  -- `rferencia` VARCHAR(30) COMMENT 'REFERENCIA DE LA UBICACIÓN DE LA ZABD',
  `latitud` DOUBLE COMMENT 'LATITUD DE LA ZABD',
  `longitud` DOUBLE COMMENT 'LONGITUD DE LA ZABD',
  `altitud_max` INT(5) COMMENT 'ALTITUD MAXIMA DE LA ZABD',
  `altitud_min` INT(5) COMMENT 'ALTITUD MINIMA DE LA ZABD',
  `doc_georeferenciacion` VARCHAR(30) COMMENT 'DOCUMENTO ADJUNTO DE POLIGONOS GEOREFERENCIALES',
  `mapa_img` VARCHAR(30) COMMENT 'IMAGEN DEL MAPA DE LA ZABD',
  `observacion` VARCHAR(300) COMMENT 'OBSERVACION O ANOTACION',
  `availability` BIT(1) DEFAULT 1 COMMENT '1 DISPONIBLE / 0 NO DISPONOBLE',
  `status` TINYINT DEFAULT 1 COMMENT 'ESTADO DEL REGISTRO: 0 ELIMINADO / 1 VIGENTE'
);
ALTER TABLE `tb_zabd` COMMENT = 'RELACIÓN DE TODAS LAS ZONAS DE AGROBIODIVERSIDAD';
TRUNCATE tb_zabd;

