  `numero_pagina_expediente_adjunto` VARCHAR(19)  COMMENT'NUMERO DE LA PAGINA DEL EXPEDINTE ...',
  `descripcion_tramite` VARCHAR(300) COMMENT'DESCRIPCION GENERAL DEL TRAMITE A REALIZAR',
  `tb_zabd_id` INT COMMENT 'ID QUE HACE REFERENCIA A LA TABLA ZABD',
  status TINYINT DEFAULT 1 COMMENT 'ESTADO DEL REGISTRO: 0 ELIMINADO / 1 VIGENTE'
);
