	(17,17,6,'001-2019-INIA-DRGB-SDRG-DASM','2019-02-12 00:00:00','2019-03-26 00:00:00','Carlos Edmundo Millones Chaname','Opinión Técnica sobre el expediente de andenes Cuyocuyo, que postula al Reconocimiento como Zona de Agrobiodiversidad.','Oficio Nº 049-2018-MDC/A','768 - 769',NULL,'Informe de consultoría en conservación in situ Nº 5 (2018 - 2019)','770 - 789',NULL,'Después de 2 dos visitas en las fechas enero y diciembre de 2018 (Inspección ocular), realizada por el consultor Dr. Diego Sotomayor especialista en conservación in situ, quien verifica la información consignada en el expediente técnico y evaluando el cumplimiento de las condiciones para el reconocimiento como zona de agrobiodiversidad. Quien emite opinión técnica favorable para el área comprendida en el expediente técnico “Andenes Cuyocuyo” sea reconocida como ZABD.',1,1),
