	(19,19,5,'266-2019-MINAGRI-INIA-GG-OAJ','2019-05-13 00:00:00','2019-05-13 00:00:00','Jorge Eduardo Jimenes Davalos - Director General de la DRGB','Reconocimineto como zona de agrobiodiversidad "Cuyocuyo".','Memorando Nº 122-2019-MINAGRI-INIA-DRGB-SDRG
Informe técnico Nº 001-2019-INIA-DRGB-SDRG-DASM','794',NULL,NULL,NULL,NULL,'La OAJ menciona que las discrepancias existentes entre las superficies inscritas en las partidas electrónicas de cada comunidad y las mencionadas en el expediente técnico, aún no están aclaradas por parte del solicitante. 
Por otro lado, la DRGB debe pronunciarse acerca de las actividades de los derechos mineros comunicados por el solicitante (Cantera Ñacoreque, Kelly I, Koricancha 2016 y Cosur I) afectan o no las condiciones para que “Andenes Cuyocuyo” sea reconocida como ZABD. Asimismo, si la zona propuesta se encuentra sobre ANP.',1,1),
	(20,20,2,'267-2019-WCS-Wildlife Conservation-Society','2019-05-20 00:00:00','2019-05-20 00:00:00','Manuel Augusto Montes Boza - Superintendente Nacional SUNARP','Se Solicita aclara la discrepancia entre la información cartográfica digitalizada entregada por Sunarp y la inscrita en partidas electrónicas de las comunidades campesinas del ámbito de Propuesta de Zona de Agrobiodiversidad de Cuyocuyo, Provincia de sandia departamento de Puno.',NULL,'824',NULL,NULL,NULL,NULL,'Wildlife Conservation Society solicita aclaración de discrepancias entre las superficies cartográfica digitalizada Entregada por Sunarp utilizada en el expediente técnico y la inscrita en las partidas electrónicas de las CC. involucradas del ámbito de la propuesta de ZABD.',1,1),
	(21,21,1,'127-2019-SUNARP-SCT/DTR',NULL,NULL,'Mariana Montoya - Directora de Wildlife Conservation Society','Aclaración de discrepancias entre la información cartográfica entregada por la Sunarp y las inscritas en las partidas electrónicas.','Carta Nº 267/19 remitida por Wildlife Conservation Society
Hoja de tramite Nº 00 01-2019 008346','825',NULL,NULL,NULL,NULL,'La SUNARP Indican que la informacion grafica según Catastro corresponden a perimetros reconstruidos en base a los documentos tecnicos que obran en los titulos archivados, es decir que dicha informacion fue escaneada y luego digitalizada, lo cual genera una diferencia entre los inscrito en la partida registral y lo digitalizado, se realiza este procedimiento, debido a que las CC. no poseen cuadro de datos tecnicos con coordenadas UTM  de cada uno de sus vertices lo cual no permite tener una reconstruccion exacta del perimetro, dando como resultado esta diferencia entre el área gráfica y el area inscrita en la partida registral.',1,1),
	(22,22,1,'044-2019MDC/A','2019-05-24 00:00:00','2019-06-06 00:00:00','Jorge Eduardo Jimenes Davalos - Director General de la DRGB','Levantamiento de observaciones y tercera entrega del expediente técnico para el reconocimiento de zonas de agrobiodiversidad “Andenes Cuyocuyo”.','Oficio Nº 159-2018-MINAGRI-INIA-DRGB/SDRG','754',NULL,'Informe de Levantamiento de observaciones   
Expediente técnico (tercera versión)','752 -753, 490 -751
',NULL,'El representante de la zona propuesta Sr. Ubaldo Ochochoque Mamani, alcalde de Cuyocuyo, envía un informe con el levantamiento de observaciones mencionadas en el oficio Nº 159-2018-MINAGRI-INIA-DRGB-SDRG, sobre las discrepancias entre las superficies consignadas en las partidas registrales y el catastro (base de datos digital). Quienes indican esta divergencia de superficies de las 6 comunidades CC. integradas se debe básicamente al uso de diferentes métodos de medición de superficie en un perímetro dado. Asimismo, en esos tiempos no se utilizaban métodos de medición tan precisos como se usan en la actualidad. Además, que estas discrepancias no afectan la zona propuesta como ZABD.',1,1),
	(23,23,6,'Nº 012-2019-INIA-DRGB-SDRG-DASM','2019-06-18 00:00:00','2019-06-21 00:00:00','Carlos Edmundo Millones Chaname - SDRG','Reconocimineto como zona de agrobiodiversidad "Cuyocuyo".','Memorando 266-2019-MINAGRI-INIA-GG-OAJ','801',NULL,NULL,NULL,NULL,'En respuesta al Memorando 266-2019-MINAGRI-INIA-GG-OAJ donde se menciona que la DRGB, debe pronunciarse de manera especifica si las actividades que se deriven de cada uno de los derechos mineros comunicados por el solicitante (Cantera Ñacoreque, Kelly I, Koricancha 2016 y Cosur I) afectan o no a las condiciones para que “Andenes Cuyocuyo” sea reconocida como ZABD.
En respuesta a esto en el informe 001-2019-INIA-DRGB-SDRG-DASM con informe adjunto 5(2018-2019) en las cuales se verifico que los derechos mineros comunicados por el solicitante no se encuentran activos dentro del área propuesta como ZABD. Por lo tanto, no afectan las condiciones para que “Andenes Cuyocuyo” sea reconocida como ZABD.
La zona propuesta tampoco se encuentra dentro de una ANP por el estado, por lo que no vieron necesario solicitar opinión técnica a SERNANP.',1,1),
	(24,24,5,'367-2019-MINAGRI-INIA-DRGB-SDRG','2019-06-25 00:00:00','2019-06-26 00:00:00','Cesar Arturo Revoredo Castañeda - Director General de la Asesoría Jurídica','Remite informe sobre levantamiento de observaciones para el reconocimiento de ZABD “Andenes Cuyocuyo”.','Memorando 266-2019-MINAGRI-INIA-GG-OAJ','802',NULL,NULL,NULL,NULL,'La SDRG remite informe Nº 012-2019-INIA-DRGB-SDRG-DASM a la OAJ, con el levantamiento de observaciones, anexando también el Oficio Nº 044-2019MDC/A contenida del tercer expediente técnico con el levantamiento de observaciones.',1,1),
	(25,25,5,'467-2019-MINAGRI-INIA-GG/OAJ','2019-08-09 00:00:00','2019-08-09 00:00:00','Juan Carlos Guerrero Abad - Director General de la DRGB','Reconocimineto como zona de agrobiodiversidad "Cuyocuyo".','Memorando 367-2019-MINAGRI-INIA-DRGB-SDRG
