Memorando 266-2019-MINAGRI-INIA-GG-OAJ','803 - 804',NULL,NULL,NULL,NULL,'La OAJ indica que la DRGB tiene que emitir opinión técnica sobre la tercera versión del expediente técnico, debido a que esta es ingresada nuevamente y la opción técnica favorable fue dada a la segunda versión del expediente. 
