	(26,26,5,'497-2019-MINAGRI-INIA-DRGB/DG','2019-08-26 00:00:00','2019-08-27 00:00:00','Patricia Siboney Muñoz Toia - Directora General de Oficina de administración','Solicito copia literal de partidas electrónicas verificadas de seis predios en el distrito de Cuyocuyo.',NULL,'826',NULL,NULL,NULL,NULL,'La DRGB Solicita a la Oficina de administración, facilitar las copias literales actualizadas de las partidas electrónicas de las 6 CC. Involucradas en la postulación de “Andenes Cuyocuyo” como ZABD.',1,1),
	(27,27,6,'020-2019I-INIA-DRGB/SDRG-DASM','2019-08-27 00:00:00','2019-09-03 00:00:00','Carlos Amasifuen Guerra - Director de la Sub Dirección de Recursos Genéticos','Opinión técnica sobre la tercera versión del Expediente Andenes Cuyocuyo que postula al Reconocimiento como Zona de Agrobiodiversidad.','Memorando 467-2019-MINAGRI-INIA-GG/OAJ','852 - 853',NULL,NULL,NULL,NULL,'El especialista en Conservación In situ Dr. Diego Sotomayor, consultor del INIA emite su opinión técnica favorable para que le área comprendida en el expediente técnico “Andenes Cuyocuyo” en su tercera versión sea reconocido como ZABD. Aclarando que esta opinión técnica se construye sobre el informe técnico 001-2019-INIA-DRGB-SDRG-DASM con informe adjunto producto de consultoría Nº 5(2018-2019).',1,1),
	(28,28,5,'835-2019-MINAGRI-INIA-GG-OA 081 UP','2019-09-03 00:00:00','2019-09-03 00:00:00','Juan Carlos Guerrero Abad - Director General de la Dirección de Recursos Genéticos y Biotecnología','Solicitud de copias literales actualizadas de partidas electrónicas.','Memorando 497-2019-MINAGRI-INIA-DRGB/DG','827',NULL,NULL,NULL,NULL,'La oficina de Administración en respuesta memorando Nº 497-2019-MINAGRI-INIA-DRGB/DG, indica que la única institución que puede expedir las copias literales de una partida electrónica es SUNARP, por lo tanto, corresponde solicitar la información en dicha institución.',1,1),
	(29,29,5,'507-2019-MINAGRI-INIA-DRGB/DG','2019-09-03 00:00:00','2019-09-03 00:00:00','Cesar Arturo Revoredo Castañeda - Director General de la Asesoría Jurídica','Levantamiento de observaciones sobre expediente “Andenes Cuyocuyo” que postula al reconocimiento como zona de agrobiodiversidad.','Memorando 467-2019-MINAGRI-INIA-GG/OAJ','854 - 855',NULL,NULL,NULL,NULL,'La DRGB remite el levantamiento de 5 observaciones realizadas por la OAJ en el menorando Nº 467-2019-MINAGRI-INIA-GG/OAJ.
La primera observación sobre la opinión técnica de la DRGB sobre la tercera versión del expediente técnico. En la cual se adjunta el informe técnico Nº 001-2019-INIA-DRGB-SDRG-DASM, del Dr. Diego Sotomayor, especialista en Conservación In situ que sustenta una opinión técnica favorable sobre el expediente.
La segunda sobre derechos de propiedad de las tierras de las CC. Involucradas, se verifico que todas las CC. cuentan con partidas registrales de SUNARP por lo que se encuentran debidamente inscritas, las cuales han sido adjuntadas en el expediente técnico.
El tercer punto con respecto al orden del expediente que sustenta la ZABD considerando las disposiciones del TUO de la ley Nº 27444, se ha presentado el expediente ordenado y compaginado en dos anillados.
En el cuarto punto se adjuntan documentos solicitados en el memorando de referencia, tales como copias fedateadas de documentos que no figuran en el expediente técnico. 
Para la quinta observación, se adjuntan copias actualizadas de las 6 partidas electrónicas correspondiente a las CC. Involucradas.
Finalmente se solicita la opinión legal de la OAJ sobre el expediente.',1,1),
