	(140,21,5,'1096-2021-MIDAGRI-INIA-DRGB/DG','2021-12-10 00:00:00','2021-12-10 00:00:00','Maria Angelita Pozo López - Directora General de la OAJ','Presenta Levantamiento de Observaciones PAYMAKIS.','Informe Nº 005-2021-MCM-APU','102',NULL,NULL,NULL,NULL,'Se remite el Levantamiento de Observaciones relacionadas al Memorando Nº 416-2021-MIDAGRI-INIA-GG/OAJ, extremo: “aclaración acerca de los derechos reales sobre el área que constituye la postulación a Zona de Agrobiodiversidad de la CC de Payancca, materia de la observación.',6,1),
	(141,22,2,'022-2021-MIDAGRI-INIA-DRGB/DG','2021-12-13 00:00:00','2021-12-13 00:00:00','Magaly Curazzi Mantilla - Representante del Expediente "Paymakis"','Levantamiento de observaciones.','Informe Nº 005-2021-MCM-APU','94',NULL,NULL,NULL,NULL,'Hacer de su conocimiento que la información remitida está incompleta; debiendo hacer llegar en el corto tiempo, los documentos de registros públicos obtenidos por acceso a la información pública (transparencia) - lo cual genera la emisión de copias certificadas que acreditan la información contenida.',6,1),
	(142,23,2,'002-2021-MCM-APU','2021-12-16 00:00:00','2021-12-16 00:00:00','Juan Carlos Guerrero Abad - Director General de la DRGB','Levantamiento de observaciones.','Carta Nº 022-2021-MIDAGRI-INIA-DRGB/DG','93',NULL,NULL,NULL,NULL,'Hacer de su conocimiento, que los documentos fueron solicitados por transparencia y acceso a la información pública, como también servicio de publicidad registral, siendo estos los mecanismos para obtener el Informe Nº 037-2018-Z.R.Nº X/OC, que sustenta el estudio técnico del área en controversia, (adjuntado en el Informe Nº 005-2021-MCM-AP), la cual ya no forma parte del total de área de la Cc de Payancca, quien postula para su reconocimiento con ZABD. Sin embargo, este Informe Nº 037-2018-Z.R.Nº X/OC, no puede ser certificado, porque no forma parte de un título o búsqueda catastral, (ACCESO A LA INFORMACIÓN NO REGISTRAL) por lo que solo se expiden copias simples. Todo esto amparado en el Texto Único de Procedimientos Administrativos de la Superintendencia Nacional de los Registros Públicos.',6,1),
	(143,24,4,'006-2021-MCM-APU','2021-12-30 00:00:00','2021-12-30 00:00:00','Juan Carlos Guerrero Abad - Director General de la DRGB','Levantamiento de observaciones.','Carta Nº 022-2021-MIDAGRI-INIA-DRGB/DG','86 - 92',NULL,NULL,NULL,NULL,'En consecuencia, correspondería continuar con el trámite de la postulación del Expediente Técnico Paymakis, ante el Instituto Nacional de Innovación Agraria - INIA, toda vez, que el área en controversia ya no forma parte del área total de postulación, así mismo, se adjuntan los antecedentes del área en controversia para mayor conocimiento.',6,1),
	(144,25,5,'1148-2021-MIDAGRI-INIA-DRGB/DG','2021-12-30 00:00:00','2021-12-30 00:00:00','Maria Angelita Pozo López - Directora General de la OAJ','Presenta Levantamiento de Observaciones de la Apoderada de PAYMAKIS.','Informe Nº 006-2021-MCM-APU','85',NULL,NULL,NULL,NULL,'Se remite el Levantamiento de Observaciones relacionadas a la Carta Nº 022-2021-MIDAGRI-INIA-DRGB/DG.',6,1),
