	(147,28,5,'012-2022-MIDAGRI-INIA-DRGB/DG','2022-01-07 00:00:00','2022-01-07 00:00:00','Maria Angelita Pozo López - Directora General de la OAJ','Presenta Opinión Técnica sobre Expediente PAYMAKIS.','Informe Nº 006-2021-MDAGRI-INIA-DRGB/SDRG','42',NULL,NULL,NULL,NULL,'Traslada el Informe Técnico 003- 2021-INIA-DRG/SDRG-DASM elaborado por el Dr. Diego Alejandro Sotomayor Melo, Consultor Especialista en Conservación in situ, de la SDRG, quien emite opinión Técnica favorable al Expediente PAYMAKIS, que postula al Reconocimiento como Zona de Agrobiodiversidad.',6,1),
	(148,29,5,'022-2022-MIDAGRI-INIA-DRGB/DG','2022-01-11 00:00:00','2022-01-12 00:00:00','Maria Angelita Pozo López - Directora General de la OAJ','Remite mapa del área geográfica de “PAYMAKIS”, que postula al reconocimiento como Zona de Agrobiodiversidad.','Memorando Nº 012-2021-MIDAGRI-INIA-DRGB/DG','40 - 41',NULL,NULL,NULL,NULL,'Se remite el mapa del área geográfica de “PAYMAKIS” que postula al reconocimiento como Zona de Agrobiodiversidad por la región Apurimac, con una superficie total a 14 261,63 ha, ubicadas en el distrito de Lambrama - provincia de Abancay y departamento de Apurímac; para el trámite pertinente.',6,1),
