    `tb_etapa` COMMENT = 'ETAPAS DE LOS CONOCIMIENTOS TRADICIONALES, EJEMPLO: SIEMBRA, GERMINACIÓN';


-- ===================================== CONOCIMIENTO TRADICIONAL ============================================
DROP TABLE IF EXISTS tb_conocimiento_tradicional;
CREATE TABLE `tb_conocimiento_tradicional` (
  `id` INT PRIMARY KEY NOT NULL AUTO_INCREMENT COMMENT 'NÚMERO ÚNICO QUE IDENTIFICA AL REGISTRO',
  `numero_correlativo` INT COMMENT 'NÚMERO ASIGNADO POR EL USUARIO SEGÚN ORDEN DEL REGISTRO',
  `nombre_tradicional_conocimiento` VARCHAR(200) COMMENT 'TRADICIONES ENCONTRADAS EN CADA ZONA DE AGROBIODIVERSIDAD',
  `tb_sector_id` INT COMMENT 'SECTOR O ÁREA DONDE SE APLICA EL CONOCIMIENTO TRADICIONAL',
  `tb_metodo_id` INT COMMENT 'METODOS O ACCIONES EJECUTADAS EN CADA CONOCIMIENTO TRADICIONAL',
  `descripcion` VARCHAR(1000) COMMENT 'DETALLE DE LO QUE SE REALIZA EN ESTE CONOCIMIENTO TRADICIONAL',
  `tb_zabd_id` INT COMMENT'ZONA DE AGROBIODIVERSIDAD AL QUE PERTENECE',
  status TINYINT DEFAULT 1 COMMENT 'ESTADO DEL REGISTRO: 0 ELIMINADO / 1 VIGENTE'
);
ALTER TABLE `tb_conocimiento_tradicional` COMMENT = 'REGISTRO DE TODOS LOS CONOCIMIENTOS TRADICIONALES QUE EXISTEN EN CADA ZABD';

1. Cosecha de papa en los laymes
2. Selección de papas amargas (aprox 80% de la cosecha total).
3. Transporte de la papa hacia zonas en donde se presenten heladas fuertes 
4. Ubicación de la cabaña temporal y tendido de la papa en la explanada
5. La papa soportará una, dos, hasta tes noches de heladas.
6. Luego de transcurridos los días de helada, se agrupa la papa en pequeños montones de 2 a 5 kg.
7. Bajo los rayos del sol, los montones de papa deben ser apisonados a fin de extraer el agua de los tubérculos.
8. Etapa llamada "prechuño" : los tubérculos se depositan en corrientes de agua por 1 o 2 noches.
9. Retirar de la corriente de agua y dejar secar bajo sol.
10. Transportar el chuño a las casas para almacenar.',6,1),
	(139,139,'Abono orgánico',1,4,'Se realiza con estiércol de oveja.',6,1),
	(140,140,'Alforqa',1,4,'Bolso utilizado para el traslado de productos agrícolas o domésticos durante la siembra y en la cosecha. Transporte de semillas.',6,1),
	(141,141,'Allachu',1,4,'Principal herramienta para extraer (cosechar) tubérculos.',6,1),
	(142,142,'Chaquitaclla',1,5,'Principal herramienta para arar y voltear la tierra.',6,1),
	(143,143,'Lamparo',1,4,'Reposadero para la fabricación de queso o mantenimiento de los alimentos.',6,1),
	(144,144,'Maran, Mutka',1,4,'Herramienta para moler alimentos.',6,1),
	(145,145,'Odre',3,NULL,'Recipiente de cuero para el traslado de bebidas como chicha, alcoholes, etc.',6,1),
	(146,146,'Sara tipina',NULL,NULL,NULL,6,1),
	(147,147,'Soqos',9,NULL,'Cañas de pescar artesanales fabricadas para la pesca de trucha.',6,1),
	(148,148,'Tunas pallana',1,4,'Herramienta para cosechar tuna.',6,1),
	(149,149,'Wantuna',NULL,NULL,'Instrumento de trabajo para el transporte de materiales en las chacras o construcciones.',6,1),
	(150,150,'Waska',NULL,NULL,'Cuerdas de cuero para trabajos agropecuarios o domésticos.',6,1),
	(151,151,'Waqalli',3,NULL,'Procesiones para pedir con tonos tristez al "Hanay pacha" la presencia de lluvias.',6,1),
	(152,152,'Cruzchacuy',3,NULL,'Visita a lagunas o cerros considerados sagrados para rendir culto y ofrendas a los dioses a fin de obtener bendiciones y clima apto para buena producción de cultivos.',6,1),
	(153,153,'Watias',3,NULL,'Hornear papa en hornos construidos con champas en la chacra.',6,1),
	(154,154,'Ayni',3,NULL,'Intercambio de trabajo entre comuneros, la cual asegura disponibilidad de mano de obra para los trabajos agropecuarios durante momentos "cuello de botella". Las familias que realizan el trabajo tienen el cargo de "Chaqrakuq".',6,1),
	(155,155,'Trashumancia',3,NULL,'Movilizar los hatos ganaderos a través de las chacras para acceder a los residuos de cosecha.',6,1),
	(156,156,'Tutapa',3,NULL,'Trabajos realizados por adultos y niños en horas de la mañana (4-5 am) en las parcelas de maíz más cercanas a los centros poblados.',6,1),
	(157,157,'Tardepa',3,NULL,'Trabajos realizados por adultos y niños en horas de la tarde (a partir del mediodía) en las parcelas de maíz más cercanas a los centros poblados.',6,1),
	(158,158,'Contrato',3,NULL,'Trabajos realizados por escolares a cambio de remuneraciones, sin obligación de trabajo recíproco.',6,1),
	(159,159,'Chaqra regay',1,4,'Primer riego. Riego antes de la preparación del suelo.',6,1),
	(160,160,'Minkakuy',3,NULL,'Momento de suplica o petición de trabajadores para afiliar o reclamar la relación de reciprocidad de trabajo.',6,1),
	(161,161,'Chaqrakuy',3,NULL,'Día en el que se inicia preparación del suelo y siembra.',6,1),
	(162,162,'Tinkay',3,NULL,'Ritual que consiste en agradecer a la Pachamama por la fertilidad. El qatay doroge el ritual simbolizado con una vara; se inicia hundiendo las chaquitacllas en cuyas bases se colocan semillas, flores y hojas de coca. Se arman parejas de ambos sexos , representando el sentido de la dualidad de la cosmovisión andina.',6,1),
	(163,163,'Wankay',3,NULL,'Serie de canciones entonadas por mujeres mientras que el Qatay trata de tocarles las entrepiernas con la vara (Wanu). Después de realizar los surcos en la chacra, las mujeres colocan las semillas (Uskay).',6,1),
	(164,164,'Tarpupay',1,4,'Resiembra en lugares de la chacra en donde no hubo brote de plantas.',6,1),
	(165,165,'Waman qallmay',1,4,'Tres semanas depues del brote de plántulas, se procede a la priemra intervención, la cual consiste en el deshierbo, primer aporque y monitoreo de plagas o enfermedades.',6,1),
	(166,166,'Qalqe',1,4,'Segundo aporque realizado al mes de la primera intervención.',6,1),
	(167,167,'Kutipa',1,4,'Último aporque al florecer el maíz. Acto acompañado de musica con esquelas, tinyas, etc. Se realiza el ritual de  Tinkay, en el cual el Qatay entierra los maíces para devolverlos a la Pachamama.',6,1),
	(168,168,'Wanlla sara',1,4,'Intercambio de productos contra trabajo durante la cosecha de maíz.',6,1),
	(169,169,'Chaqma',1,5,'Se realiza entre los meses de julio y agosto. Se rotura una primera columna para marcar la parcela (Chaqra uqariy), se determina una plaza en la cual se hará el trabajo de roturación. Se realiza el Rapay, el cual consiste en que un hombre y una mujer (parejas) roturan y voltean el suelo, respectivamente.',6,1),
	(170,170,'Pakuy',1,5,'En septiembre, después de la chaqma, se realiza la actividad de desmenuzar las champas secas que quedaron después de la roturación.',6,1),
	(171,171,'Wachuchay',1,5,'Trazado de surcos - surcado.',6,1),
	(172,172,'Safio',1,5,'Trabajo que se realiza en los laymes en paralelo a la chaqma; consisten en voltear de raíz a las malezas, tales como Waraqo, Tayanco, etc.',6,1),
	(173,173,'Papa tarpuy',1,4,'Realizada en septiembre, después del Pakuy. Siembra de papa en las parcelas más bajas.',6,1),
	(174,174,'Choqe o Choqe tarpuy',1,4,'Siembra directa de papa (se abren hoyos con la chaquitaclla y se introduce la semilla).',6,1),
	(175,175,'Choqe tiqray',1,5,'Hace referencia al primer y único aporque que se hace a las plantas en tierras altas en octubre. Se hacen surcos invertidos con profundos canales.',6,1),
	(176,176,'Wawachay',1,5,'Aporque que se hace a las plantas en tierras bajas en diciembre.',6,1),
	(177,177,'Qotoy',1,5,'Último porque que se hace a las plantas en tierras bajas en enero.',6,1),
	(178,178,'Watia / Wanlla',1,4,'Intercambio de productos contra trabajo durante la cosecha de papa, entre abril y mayo.',6,1),
	(179,179,NULL,1,4,'Cultivados en laymes de dos años consecutivos en zonas templadas. Se cultivan al segundo año, despues de la primera campaña de papa, aprovechando el rebrote de las mismas denominados Kipa.',6,1),
	(180,180,NULL,1,4,'Se cultiva en asociación con maíz.',6,1),
	(181,181,'Patrón de San Blas',3,NULL,'Fiesta que implica la peregrinación de los comuneros hacia la capital del distrito para celebrar el cargo y velo de la imagen del patrón San Blas.',6,1),
	(182,182,'Patrón de San Marcos',3,NULL,'Fiesta que implica la peregrinación de fieles y animales desde las alturas a la capital para realizar un festejo en busca de bendiciones en la actividad pecuaria. Se realiza la corrida de toros (Waca puckllay).',6,1),
	(183,183,'Corpus Cristi',3,NULL,'Fiesta que implica la peregrinación hacia la capital del distrito para celebrar alrededor de altares traídos de la ciudad del Cusco durante 7 a 8 días. Mezcla cristiana y de pagos a los dioses andinos (Apus) con animales sacrificados. Se realiza a mediados del mes de Junio.',6,1),
	(184,184,'Niño velakuy',3,NULL,'Celebración realizada en los centros poblados respectivos donde se celebra el nacimiento y vela del niño Jesús. Se realiza el 24 al 25 de diciembre.',6,1),
	(185,185,'Patrón Santiago',3,NULL,'Fiesta que implica la peregrinación hacia la capital del distrito para celebrar el cambio de ropa del patrón Santiago o patrón de los caballos para bendecir dichos hatos. Se realizan carreras y sacrificios de animales. Se realiza el 24 de julio.',6,1),
	(186,186,'Señor de la Tabla Cruz',10,NULL,'Peregrinación que se realiza a inicios del mes de mayo, la cual consiste en un recorrido hacia la "Tabla Cruz" con el ojetivo de obtener bendiciones; así mismo tiene lugar una competencia entre jinetes que afrontan la lejanía y peligrosidad del camino. Se considera una festividad obligada sobre todo para los jóvenes en toda la zona.',6,1),
	(187,187,'Todos los santos',10,NULL,'Visita de tumbas con festejos, danzas y alimentos específicos.',6,1),
	(188,188,'Aniversario de Lambrama',10,NULL,'Desde las comunidades se "baja" a la capital para celebrar el aniversario de la creación política junto a las intituciones del Estado.',6,1),
	(189,189,'Carnaval campesino de Lambrama',10,NULL,'Tumbado de árboles al son de danzas, bebida, comida y cantos. Así mismo se hacen competencias entre comunidades campesinas.',6,1),
	(190,190,'Fiesta patronal de Santa Isabel Virgen de Caype',10,NULL,'Momento de oculto a la patrona de la comunidad e iglesia, Santa Isabel Virgen de Caype. Se realiza en julio.',6,1);

