DROP TABLE IF EXISTS tb_conocimiento_empleado;
CREATE TABLE `tb_conocimiento_empleado` (
  `id` int primary key AUTO_INCREMENT COMMENT 'ID IDENTIFICADOR',
  `tb_conocimiento_tradicional_id` int(11) DEFAULT NULL COMMENT'ID DE LA TABLA PRINCIPAL DE CONOCIMIENTO TRADICIONAL',
  `tb_conocimiento_id` int(11) DEFAULT NULL COMMENT'ID DEL TABLA DE CONOCIMIENTOS QUE SE EMPLEAN',
  `status` TINYINT DEFAULT 1 COMMENT'ESTADO DE TABLA 0 ELIMINADO, 1 ACTIVO'
) ENGINE=InnoDB DEFAULT CHARSET=utf8;
ALTER TABLE `tb_conocimiento_empleado` COMMENT = 'TABLA DE MUCHOS A MUCHOS QUE RELACIONA LA TABLA DE CONOCIMIENTO TRADICIONAL CON CONOCIMIENTO';

-- ===============
drop table if exists tb_conocimiento;
CREATE TABLE IF NOT EXISTS tb_conocimiento (
        `id` INT PRIMARY KEY not null AUTO_INCREMENT COMMENT 'NÚMERO ÚNICO QUE IDENTIFICA AL REGISTRO',
        `conocimiento` VARCHAR(50) CHARACTER SET utf8 COMMENT 'NOMBRE DEL CONOCIMIENTO TRADICIONAL IDENTIFICADO EN TODAS LAS ZONAS DE AGROBIODIVERSIDAD',
        status TINYINT DEFAULT 1 COMMENT 'ESTADO DEL REGISTRO: 0 ELIMINADO / 1 VIGENTE'
    );

ALTER TABLE `tb_conocimiento` COMMENT = 'GRUPO DE CONOCIMIENTOS TRADICIONALES QUE SE EMPLEAN EN LAS ZONAS DE AGROBIODIVERSIDAD';


-- ===============
DROP TABLE IF EXISTS tb_cultivo;
CREATE TABLE `tb_cultivo` (
  `id` INT PRIMARY KEY NOT NULL AUTO_INCREMENT COMMENT 'NÚMERO ÚNICO QUE IDENTIFICA AL REGISTRO',
  `cultivo` VARCHAR(50) COMMENT 'CULTIVOS EXISTENTES EN LAS ZONAS DE AGROBIODIVERSIDAD',
  status TINYINT DEFAULT 1 COMMENT 'ESTADO DEL REGISTRO: 0 ELIMINADO / 1 VIGENTE'
);
ALTER TABLE `tb_cultivo` COMMENT = 'LISTA DE CULTIVOS QUE HAY EN UNA AGROBIODIVERSIDAD';
-- ===============
DROP TABLE IF EXISTS tb_cultivo_conocimiento;
    CREATE TABLE `tb_cultivo_conocimiento` 
(
    `id`	INT PRIMARY KEY NOT NULL AUTO_INCREMENT COMMENT'IDENTIFICADOR DEL REGISTRO',
    `tb_conocimiento_tradicional_id`	INT COMMENT'ID DE LA TABLA DE CONOCIMIENTOS TRADICIONALES',
    `tb_cultivo_id`	INT COMMENT'ID DE LA TABLA DE CULTIVOS',
    `status` TINYINT DEFAULT 1 COMMENT 'ESTADO DE TABLA 0 ELIMINADO, 1 ACTIVO'
)COMMENT'TABLA DE MUCHOS A MUCHOS ENTRE CULTIVOS Y CONOCIMIENTO TRADICIONAL';


-- ================
DROP TABLE IF EXISTS tb_etapa_conocimiento;

CREATE TABLE
    `tb_etapa_conocimiento` (
        id int PRIMARY key AUTO_INCREMENT,
        `tb_conocimiento_tradicional_id` INT COMMENT 'ID DE CONOCIMIENTO TRADICIONAL',
        `tb_etapa_id` INT COMMENT 'ID DE LA ETAPA EN LA QUE SE ENCUENTRA DICHO CONOCIMIENTO TRADICIONAL',
        status TINYINT DEFAULT 1 COMMENT 'ESTADO DEL REGISTRO: 0 ELIMINADO / 1 VIGENTE'
    );

ALTER TABLE
    `tb_etapa_conocimiento` COMMENT = 'RELACION ENTRE LA TABLA DE ETAPAS Y LA TABLA DE CONOCIMIENTOS TRADICIONALES';


-- ================
DROP TABLE IF EXISTS tb_etapa;
CREATE TABLE `tb_etapa` (
  `id` INT PRIMARY KEY NOT NULL AUTO_INCREMENT COMMENT 'NÚMERO ÚNICO QUE IDENTIFICA AL REGISTRO',
  `etapa` VARCHAR(40) COMMENT 'NOMBRE DE ETAPAS DE COCIMIENTO TRADICIONAL',
  `status` TINYINT DEFAULT 1 COMMENT 'ESTADO DEL REGISTRO: 0 ELIMINADO / 1 VIGENTE'
);
ALTER TABLE `tb_etapa` COMMENT = 'ETAPAS DE LOS CONOCIMIENTOS TRADICIONALES, EJEMPLO: SIEMBRA, GERMINACIÓN';

-- ================
DROP TABLE IF EXISTS tb_metodo;
CREATE TABLE IF NOT EXISTS tb_metodo (
        `id` INT PRIMARY KEY NOT NULL AUTO_INCREMENT COMMENT 'ID DE IDENTIFICACIÓN',
        `metodo` VARCHAR(50) CHARACTER SET utf8 COMMENT 'METODO O ACCION DE CONOCIMIENTO',
        `status` TINYINT DEFAULT 1 COMMENT 'ESTADO DEL REGISTRO: 0 ELIMINADO / 1 VIGENTE'
    );
ALTER TABLE `tb_metodo` COMMENT = 'MÉTODOS O ACCIONES DE CONOCIMIENTO TRADICIONAL';

-- ================
DROP TABLE IF EXISTS tb_sector;
CREATE TABLE IF NOT EXISTS`tb_sector` (
  `id` INT PRIMARY KEY NOT NULL AUTO_INCREMENT COMMENT 'NÚMERO ÚNICO QUE IDENTIFICA AL REGISTRO',
  `sector` VARCHAR (50) COMMENT 'SECTOR O AREA DE CONOCIMIENTO',
  `status` TINYINT DEFAULT 1 COMMENT'ESTADO DEL REGISTRO: 0 ELIMINADO / 1 VIGENTE'
);
ALTER TABLE `tb_sector` COMMENT = 'SECTOR O AREA DE CONOCIMIENTO';

