DROP TABLE IF EXISTS tb_organizacion;
CREATE TABLE `tb_organizacion` (
  `id` INT PRIMARY KEY AUTO_INCREMENT COMMENT 'ID ÚNICO QUE IDENTIFICA AL REGISTRO',
  `nombre_organizacion` VARCHAR(50) COMMENT 'NOMBRE O TIPO DE ORGANIZACIÓN DEL CENTRO POBLADO',
  status TINYINT DEFAULT 1 COMMENT 'ESTADO DEL REGISTRO: 0 ELIMINADO / 1 VIGENTE'
);
ALTER TABLE `tb_organizacion` COMMENT = 'TIPO DE ORGANIZACION AL QUE PERTENECE LOS CENTROS POBLADOS';


-- =================
DROP TABLE IF EXISTS tb_centro_poblado;
CREATE TABLE `tb_centro_poblado` (
  `id` INT PRIMARY KEY NOT NULL AUTO_INCREMENT COMMENT 'ID ÚNICO QUE IDENTIFICA AL REGISTRO',
  `centro_poblado` VARCHAR(50) COMMENT 'NOMBRE DEL CENTRO POBLADO U ORGANIZACION QUE HAY EN UNA COMUNIDAD O ZABD',
  `tb_organizacion_id` INT COMMENT 'Organización a la que pertenece: 1. Junta de usuarios / 2. Cooperativa / 3. Asociación de productores / 4. Comunidad Campesina / 5. Comunidad Nativa',
  `tb_comunidad_id` INT COMMENT 'COMUNIDAD CAMPESINA A LA QUE PERTENECE CADA OGANIZACION',
  `status` TINYINT DEFAULT 1 COMMENT 'ESTADO DEL REGISTRO: 0 ELIMINADO / 1 VIGENTE'
);
ALTER TABLE `tb_centro_poblado` COMMENT = 'LISTA DE LOS CENTROS POBLADOS QUE EXISTEN EN LA ZABD';

-- ======================================== COMUNIDAD CAMPESINA ===========================================
drop table if EXISTS tb_comunidad;
CREATE TABLE IF NOT EXISTS `tb_comunidad` (
  `id` int(11) PRIMARY KEY NOT NULL AUTO_INCREMENT COMMENT 'ID DE INDENTIFICACION',
  `numero_correlativo` INT COMMENT'NÚMERO ASIGNADO POR EL USUARIO',
  `nombre_comunidad` varchar(50) DEFAULT NULL COMMENT 'NOMBRE DE LA COMUNIDAD',
  `nombre_segun_sunarp` varchar(50) DEFAULT NULL COMMENT 'NOMBRE DE LA COMUNIDAD SEGUN SUNARP',
  `antecendente` VARCHAR(300) DEFAULT NULL COMMENT 'ANTECEDENTES DE LA COMUNIDAD',
  `altitud_min` int(5) DEFAULT NULL COMMENT 'ALTITUD MINIMA',
  `altitud_max` int(5) DEFAULT NULL COMMENT 'ALTITUD MAXIMA',
  `altitud_inter` int(5) DEFAULT NULL COMMENT 'ALTITUD INTERMEDIA',
  `superficie_pe` double DEFAULT NULL COMMENT 'SUPERFICIE (HA) SEGÚN PARITDA ELECTRONICA SUNARP',
  `ficha_registral` varchar(20) DEFAULT NULL COMMENT 'NUMERO DE FICHA REGISTRAL',
  `partida_electronica` varchar(20) DEFAULT NULL COMMENT 'NUMERO DE PARTIDA ELECTRONICA SUNARP',
  `folio_exp` varchar(20) DEFAULT NULL COMMENT 'NUMERO DE FOLIO DEL EXPEDIENTE',
  `pagina_exp` varchar(20) DEFAULT NULL COMMENT 'NUMERO DE PAGINA DEL EXPEDIENTE',
  `nom_predio` varchar(50) DEFAULT NULL COMMENT 'NOMBRE DEL PREDIO',
  `superficie_cat` double DEFAULT NULL COMMENT 'SUPERFICIE (HA) SEGÚN CATASTRO SUNARP',
  `superficie_comunidad_zabd` double DEFAULT NULL COMMENT 'SUPERFICIE (HA) DE LA COMUNIDAD',
  `porcentaje_superficie_zabd` double DEFAULT NULL COMMENT '% DE LA SUPERFICIE DE LA COMUNIDAD',
  `tb_zabd_id` int(11) DEFAULT NULL COMMENT 'ID DE LA ZADB',
  `availability` tinyint DEFAULT 1 COMMENT 'DISPONIBLE / NO DISPONOBLE',
  `status` tinyint DEFAULT 1 COMMENT 'ACTIVO/INACTIVO '
);
ALTER TABLE `tb_comunidad` COMMENT = 'LISTA DE TODAS LAS COMUNIDADES CAMPESINAS QUE HAY EN CADA ZABD';


-- ===============
drop table if EXISTS tb_raza;
CREATE TABLE IF NOT EXISTS `tb_raza` (
  `id` int(11) PRIMARY KEY NOT NULL AUTO_INCREMENT COMMENT 'ID DE INDENTIFICACION',
  `raza` varchar(50) DEFAULT NULL COMMENT 'NOMBRE DE LA COMUNIDAD',
  `status` tinyint DEFAULT 1 COMMENT 'ACTIVO/INACTIVO '
);
ALTER TABLE `tb_raza` COMMENT = 'RAZAS ENCONTRADAS EN LA DIVERSIDAD DE CRIANZA';




