DROP TABLE IF EXISTS tb_tipo_diversidad;

CREATE TABLE IF NOT EXISTS tb_tipo_diversidad(
	`id` INT NOT NULL PRIMARY KEY AUTO_INCREMENT COMMENT 'IDENTIFICADOR DEL REGISTRO',
	`tipo_diversidad` VARCHAR (100) COMMENT'TIPO DE DIVERSIDAD',
    `status` TINYINT DEFAULT 1 COMMENT'1 VIGENTE, 0 ELIMINADO'
)COMMENT'TABLA DE TIPO DE DIVERSIDAD';

-- TABLA DE DIVERSIDAD
DROP TABLE IF EXISTS `tb_diversidad_cultivos` ;
CREATE TABLE IF NOT EXISTS `tb_diversidad_cultivos` 
(
    `id`	INT NOT NULL PRIMARY KEY AUTO_INCREMENT COMMENT'IDENTIFICADOR DEL REGISTRO',
    `id_asignado`	INT COMMENT 'ID ASIGNADO POR EL USUARIO EN EL EXCEL',
    `numero_correlativo`	VARCHAR(10) COMMENT'NUMERO CORRELATIVO ASIGNADO POR EL USUARIO, DEL ORDEN DE REGISTRO DE MANERA ASCENDENTE',
    `tb_centro_poblado_id`	INT DEFAULT NULL COMMENT'COMUNIDAD REGISTRADA A LA QUE PERTENECE DICHO CULTIVO',
    `tb_cultivo_id`	INT COMMENT 'CULTIVO',
    `tb_variedades_id`	INT COMMENT 'VARIEDAD DEL CULTIVO',
    `tb_parientes_silvestres_id`	INT DEFAULT NULL COMMENT'PARIENTE SILVESTRE DEL CULTIVO',
    `tb_nombres_comunes_id`	INT DEFAULT NULL COMMENT'NOMBRE COMUN DEL CULTIVO',
    `nombre_local`	VARCHAR(50) COMMENT'NOMBRE LOCAL DEL CULTIVO',
    `tb_nombres_cientificos_id`	INT DEFAULT NULL COMMENT'NOMBRE CIENTIFICO DEL NOMBRE COMUN',
    `tb_familias_id`	INT  DEFAULT NULL COMMENT'FAMLIA DEL NOMBRE CIENTIFICO',
    `codigo_zabd_adicional`	VARCHAR(50) COMMENT'INFORMACION ADICIONAL DEL CULTIVO',
    `codigo_accesion_adicional`	INT(20) DEFAULT NULL COMMENT'INFORMACION ADICIONAL DEL CULTIVO',
    `denominacion_lista_adicional`	VARCHAR(50) COMMENT'INFORMACIÓN ADICIONAL DEL CULTIVO',
    `observacion`	VARCHAR(300) COMMENT'COMENTARIO ADICIONAL',
    `tb_tipo_diversidad_id`	INT COMMENT'TIPO DE DIVERSIDAD: 1 CULTIVO, 2 CRIANZA, 3 FLORA, 4 FAUNA',
    `tb_zabd_id`	INT COMMENT 'ZONA DE AGROBIODIVERSIDAD DE LA QUE PROVIENE DICHA DIVERSIDAD',
    `status`	TINYINT DEFAULT 1 COMMENT'1 VIGENTE, 0 ELIMINADO',
    `available` TINYINT DEFAULT 1 COMMENT'1 DISPONIBLE, 0 NO DISPONIBLE'
);
ALTER TABLE `tb_diversidad_cultivos` COMMENT'TABLA PRINCIPAL DE AGROBIODIVERSIDAD DE CULTIVOS';


