DROP PROCEDURE IF EXISTS sp_update_conocimiento_empleado;
DELIMITER $$
CREATE PROCEDURE IF NOT EXISTS sp_update_conocimiento_empleado (in idParameter int, in arrayParameter varchar(100))
BEGIN
        declare Parametro int;
        declare arrayParameter2 VARCHAR(100);
        
    IF (arrayParameter) THEN
        SET arrayParameter2 = arrayParameter;
        WHILE (arrayParameter2 != '')   DO
            SET Parametro = SUBSTRING_INDEX(arrayParameter2,',',1 );
            IF ((select tb_conocimiento_id from tb_conocimiento_empleado where tb_conocimiento_tradicional_id = idParameter and tb_conocimiento_id = Parametro) IS NULL) THEN    
            ELSE
               UPDATE tb_conocimiento_empleado SET status = 1 WHERE tb_conocimiento_tradicional_id = idParameter AND tb_conocimiento_id = Parametro ;
               UPDATE tb_conocimiento_empleado SET status = 0 WHERE tb_conocimiento_tradicional_id = idParameter AND NOT FIND_IN_SET(tb_conocimiento_id ,arrayParameter);
            END if;

            IF (locate(',',arrayParameter2) > 0)THEN
                SET arrayParameter2 = SUBSTRING(arrayParameter2, locate(',',arrayParameter2)+1);
            ELSE
                set arrayParameter2 = '';
            END IF;
        END WHILE; 
    ELSE
        UPDATE tb_conocimiento_empleado SET status = 0 WHERE tb_conocimiento_tradicional_id = idParameter;
    END IF;
END $$
DELIMITER ;


