INSERT INTO `tb_recorrido` (`id`, `ruta_recorrido`, `distancia_recorrido`, `tiempo_recorrido_particular`, `tiempo_recorrido_popular`, `referencia_recorrido`, `tb_zabd_id`, `status`) VALUES
	(1,'Puno - Cuyocuyo',240,'04:00:00','05:00:00',NULL,1,1),
	(2,'Juliaca - Cuyocuyo',200,'03:50:00','04:50:00',NULL,1,1),
	(3,'Cusco - Pisac',35,'00:45:00',NULL,'Se toma la carretera que va hacia el Parque Arqueológico de Pisac, pasando la comunidad de Maska se toma un desvío (trocha) hacia la comunidad Saccaca, de donde se puede llegar a cualquiera de las 4 comunidades.',2,1),
	(4,'Cusco - Oropesa - Huacarpay - Andahuaylillas - Urcos - Ocongate - Marcapata',324,NULL,'05:00:00','La accesibilidad hacia la CC de Ccollasuyo es por via terrestre siguiendo la vía asfaltada de la interoceánica Sur que une la ciudad de Cusco con el distrito de Marcapata en un recorrido de 324 km, por un tiempo aproximado de 5 horas de viaje.',3,1),
	(5,'Marcapata - Ccollasuyo',41,'01:00:00',NULL,'Desde Marcapata se continúa por una trocha carrozable que une la capital del distrito con la comunidad Ccollasuyo.',3,1),
	(6,'Cusco - Oropesa - Huacarpay - Andahuaylillas - Urcos - Ocongate - Marcapata',324,NULL,'05:00:00','La accesibilidad hacia la CC de Marcapata Ccollana es por vía terrestre, siguiendo la vía asfaltada de la interoceánica Sur que une la ciudad de Cusco con el distrito de Marcapata.',4,1),
	(7,'Marcapata - Marcapata Ccollana',3,'00:10:00',NULL,'Desde Marcapata se continúa por una trocha carrozable que une la capital del distrito con la comunidad de Marcapata Ccollana.',4,1),
	(8,'Huancayo - Lampa - Pariahuanca',83,NULL,NULL,'Desde Huancayo por una carretera afirmada angosta que pasa por el nevado Huaytapallana hasta la Comunidad de Lampa capital del distrito de Pariahuanca.',5,1),
	(9,'Concepción - Comas - Pariahuanca',NULL,NULL,NULL,'Desde la provincia de Concepción pasa por el distrito de Comas y llega al lado norte de Pariahuanca pasando por la Comunidad Campesina de San Francisco de Llacsapirca y continuando por carretera carrozable hasta la Comunidad Campesina de Lampa, esta ruta es no muy accesible en época de lluvias.',5,1),
	(10,'Abancay - Lambrama',75.1,'01:47:00',NULL,'Se toma la carretera Av. Panamericana/Carretera 3S y luego  la Carretera 3SF hasta llegar a lambrama.',6,1);
