INSERT INTO `tb_conocimiento_tradicional` (`id`, `numero_correlativo`, `nombre_tradicional_conocimiento`, `tb_sector_id`, `tb_metodo_id`, `descripcion`, `tb_zabd_id`, `status`) VALUES
    (1,1,'Manda',1,1,'Conjunto de parcelas pequeñas y grandes que tienen una misma especie, regidas por una rotación de cultivos, evita la presencia de plagas, por que esta se diversifica por la cantidad de cultivo, se deja en descanso la manda.',1,1),
	(2,2,'Cancha',1,1,'De dormideros de alpacas, corderos  y llamas extraen el estiércol de la parte inferir depositado por años y cubren con este el tubérculo para esquivar al gorgojo.',1,1),
	(3,3,'Diversificación de cultivos',1,1,'Siembra en diferentes lugares y pisos altitudinales, de esta manera se evita daños causados por factores bióticos (plagas) y abióticos (heladas).',1,1),
	(4,4,'Phawa',1,1,'Nombre aymara con la que se denomina a la siembra.',1,1),
	(5,5,'Milli',1,1,'Es la siembra menor que se realiza en agosto, cerca de las casa donde no cae helada y aprovecha la humedad y se cosecha en diciembre, y chacras con riego.',1,1),
	(6,6,'katahui y ceniza',1,1,'Cal y ceniza que se acumula en las cocinas son espolvoreadas sobre el follaje de las plantas.',1,1),
	(7,7,'Hierbas biocidas',1,1,'Uso de mesclas de hierbas aromáticas fuertes como muña, ajenjo, palma real, tarwi, etc. Las cuales son fermentadas o secadas, para después usarlas en el control de plagas insectiles.',1,1),
	(8,8,'Koreo',1,1,'Deshierbo manual, las hierbas luego son suministradas a los animales.',1,1),
	(9,9,'Raukana',1,1,'Cosecha de papa con “raukana” (picos pequeños).',1,1),
	(10,10,'Jik''e',1,1,'Arranque de las primeras quinuas que alcanzaron su madures fisiológica.',1,1),
	(11,11,'Jauk''a',1,1,'Golpeo de la quinua o cañihua con las “jaucañas” (palos encorvados), sobre mantas.',1,1),
	(12,12,'kuyu',1,1,'Venteo de las semillas, el grano es levantado al viento para separar el "jipi" o desecho de la semilla.',1,1),
	(13,13,'Warsuña',1,1,'Son pequeños montones de tubérculos que son tapados con mantas, pajas o la misma brosa seca del cultivo con el fin de acelerar su maduración.',1,1),
	(14,14,'Moraya',1,2,'Los tubérculos con abúndate gorgojo son puestos en un saco y tirados a un poso, luego de un mes son retirados y consumidos.',1,1),
	(15,15,'Imaña',1,2,'Ensacado del tubérculo en sacos de tela de alpaca y guardado en un cuarto oscuro.',1,1),
	(16,16,'Imaña',1,2,'Ensacado del grano en sacos de tela de alpaca y guardado en un cuarto oscuro.',1,1),
	(17,17,'Almacenamiento de semilla',1,2,'Tubérculos poco deshidratados, de brotes vigorosos y poco verdeados para evitar al gorgojo.',1,1),
	(18,18,'Phina',1,2,'Montones de tubérculos intercalados con Muña (planta biocida) hacen pilas y colocan la semilla.',1,1),
	(19,19,'Phina',1,2,'Amarrado de maíz con Muña (planta biocida) hacen pilas y colocan la semilla.',1,1),
	(20,20,'Almacenamiento',1,2,'Almacenamiento en silos de Totora (Juncos del lago).',1,1),
	(21,21,'Manda',1,NULL,'Conjunto de parcelas que tienen una misma especie, regidas por una rotación de cultivos, evita la presencia de plagas, por ésta se diversifica por la cantidad del cultivo.',1,1),
	(22,22,'k''arpa',1,NULL,'Nombre en quechua con el que denomina a la siembra adelantada para cosechar papa en noviembre, para todos los santos (Variedades yema e ilmilla).',1,1),
	(23,23,'katawi cal',1,NULL,'Cal y ceniza que se acumula en las cocinas son espolvoreadas sobre el follaje de las plantas.',1,1),
	(24,24,'Muju',1,NULL,'Demonización en quechua a la semilla de papa.',1,1),
	(25,25,'Chochoca',1,2,'Se llerve el maíz y se deseca, se desgrana y se guarda en baldes  para ser consumidos durante 3 a 4 años.',1,1),
	(26,26,'Andeneria Ancestral',1,3,'Técnica de cultivo empleada para aprovechar las zonas de ladera, mejorando la superficie cultivable y evitando la perdida de suelo por erosión.',1,1),
	(27,27,'Rotación de cultivos',1,4,'Rotación de cultivos.',2,1),
