	(54,54,'Isanka (canasta) para cosecha de papa',1,4,NULL,2,1),
	(55,55,'Wiri',1,4,NULL,2,1),
	(56,56,'Quinto',3,NULL,'Agradecimiento a la Pachamama antes de sembrar y cosechar papa.',2,1),
	(57,57,'Amarre del espíritu de la papa',3,NULL,'Amarre del espíritu de la papa con soga hecho con lana de alpaca-después de cosechar las variedades se recolecta y se “amarra” lo recolectado para tener mayor producción el próximo año.',2,1),
	(58,58,'Barrera a la papa cosechada',3,NULL,'Barrera alrededor de la papa cosechada a base de rastrojo.',2,1),
	(59,59,'Ofrenda al Agua',3,NULL,'Durante el periodo de veranillo ofrendar el agua de otras lagunas a las lagunas en déficit hídrico.',2,1),
	(60,60,'Santurumuray',3,NULL,'Cuando la papa esta con flor, se relaciona con el linderaje como identificaría a las variedades de papa.',2,1),
	(61,61,'Unuraymi',3,NULL,'Agradecimiento a través de ofrendas por el agua.',2,1),
	(62,62,'Trueque',4,NULL,NULL,2,1),
	(63,63,'Watia',5,NULL,'Platos como Watia (horno donde se ponen las papas).',2,1),
	(64,64,'Ruki',5,NULL,'Deshidratación de la papa amarga exclusivas para chuño y moraya.',2,1),
	(65,65,'Harina de papas',5,NULL,'Harina de papas.',2,1),
	(66,66,'Papas dulces',5,NULL,'Papas dulces utilizada en sopas y sancochadas.',2,1),
	(67,67,'Papa boles',5,NULL,' Papas que no presentan demasiados ojos, fáciles de pelar.',2,1),
	(68,68,'Emplasto de papa',6,NULL,'Emplastos de papas dulces y amargas para inflamaciones de muelas entre otras.',2,1),
	(69,69,'K’aya',5,NULL,'Deshidratación de Mashua.',2,1),
	(70,70,'Linli',5,NULL,'Deshidratación de las lisas.',2,1),
	(71,71,'Calendario Agricola',1,4,'Uso de calendario agricola.',2,1),
	(72,72,'T’inina',1,4,'Herramienta para deshojar maíz.',2,1),
	(73,73,'Aporque',1,5,'Aporte de tierra a la base del cultivo (evitar plagas en encame).',2,1),
	(74,74,'Andenes',1,5,'Técnica de cultivo empleada para aprovechar las zonas de ladera, mejorando la superficie cultivable y evitando la perdida de suelo por erosión.',2,1),
	(75,75,'Aruna',NULL,7,' Siembra y cosecha de agua para irrigación y consumo.',2,1),
	(76,76,'Ch’aqchu',1,4,'Práctica que se realiza inmediatamente después del daño producido por la granizada, este propósito utiliza la Wamanlipa, Markhu, Sunchu, Pampa anís. De esta manera, el Ch’aqchu es la aplicación del referido preparado con el propósito revertir el daño ocasionado.',3,1),
	(77,77,'Chaqro / Charqo',1,4,'La mayoría conservacionistas siembran en Charqo, técnica que consiste en realizar la siembra en mezcla de muchas variedades de papas en un solo terreno de cultivo, por lo general variedades que pertenecen a un mismo grupo familiar T’aqa, en virtud a que las diferentes variedades viven en simbiosis y a la vez en competencia. En esta forma de asociación se cosecha una diversidad y variabilidad apreciable de papas nativas.',3,1),
	(78,78,'Q’apachi',7,NULL,'Rituales de curación de las plantas cuando sufren daños o están amenazadas por granizadas, nevados, truenos, daños de animales y robos. Para estos rituales, se utilizan insumos preparados a base de (wamanlipa, markhu, sunchu, pampa anís, harina de yuca, cáscara de frutas, etc.).',3,1),
	(79,79,'Q’echu Wachu',1,NULL,'Comunidades de zonas media y baja de Ocongate, la longitud de los camellones y surcos varía de 10 a 15m., se orientan en un solo sentido, diferenciada del Wachu Yapuy por la presencia de una franja pequeña de cerca de 0.50 m., sin roturación que sirve de pasadizo, también cumple la función de retener la humedad y evitar el arrastre de tierra. Se construye en función a la pendiente, si es muy pronunciada, los distanciamientos son cortos, si es llano, el distanciamiento es mayor.',3,1),
	(80,80,'Selección de semilla',1,NULL,'La semilla, se selecciona teniendo en cuenta, la forma, número de ojos y tamaño. Las categorías que se consideran son semillas de primera, segunda y tercera o Hatun muhu, Murmu muhu y Khullu muhu, estas categorías de semillas en algunos casos se mantienen separados y en otros se mantienen juntas.',3,1),
	(81,81,'Thaya / Llohay/ Rompe',1,NULL,'Sistema de barbecho, en suelos de la parte baja y de uso intensivo, una vez concluido el barbecho o roturación se deja por un tiempo de 3 a 4 meses, en seguida se prosigue con el desterronado y quemado de malezas y raíces. Este sistema de preparación se realiza aprovechando la humedad de las últimas lluvias del mes de marzo y en sitios donde se utiliza el riego de machaco.',3,1),
	(82,82,'Transformación de la papa',1,NULL,'Tubérculos destinados para la preparación de Moraya y Chuño, clasificados en categorías según tamaño (primera, segunda, tercera, cuarta), esta clasificación se realiza para facilitar el efecto de congelamiento por las heladas. Principalmente para chuño variedades: K´usi, Cuchillo P''aki, Bole, Wakaqallo.',3,1),
	(83,83,'Tratamiento de guano de corral',1,NULL,'Se inocula microorganismos en una pila de abono orgánico o guano de corral varias veces antes de sembrar y siempre regando con abundante agua, el abono mejorado mediante la acción de los micro organismos eficaces EM ayuda a la descomposición de la materia orgánica por acción de grupo de bacterias fotosintética (ácido láctico y levaduras), el proceso que dura más o menos de 2 a 3 meses, el guano debe tener una consistencia suave suelto y de color oscuro sin malos olores.',3,1),
	(84,84,'Miska',1,NULL,'Siembra de variedades de papa nativa en el mes de mayo y la cosecha en los meses de noviembre y diciembre.',3,1),
	(85,85,'Maguay',1,NULL,'Siembra de variedades de papa nativa en el mes de junio, la cosecha en el mes de diciembre y enero.',3,1),
	(86,86,'Loma tarpuy o siembra grande,',1,NULL,'Siembra de variedades nativas de papa agosto y setiembre y la cosecha en los meses de mayo y junio.',3,1),
	(87,87,'Muyuy',1,NULL,'Denominación a los terrenos de rotación.',3,1),
	(88,88,'Tinkuy',3,NULL,'Ritual donde se pide permiso, a la Pachamama y a los Apus del lugar, ofrendándoseles coca Q’uintu y aguardiente o vino junto con invocaciones y oraciones, esta ceremonia generalmente este cargo de la familia propietaria de la chacra.',3,1),
	(89,89,'Wachu',1,NULL,'Es la labranza del primer surco a manera de ejemplo, determinando el ancho y profundidad del wachu o surco.',3,1),
	(90,90,'Quncas',1,NULL,'Surcos tranversales.',3,1),
	(91,91,'T’aya',1,NULL,'Labranza en terrenos planos,siempre de la mano de la chaquitaclla y el grupo de ayni.',3,1),
	(92,92,'Chuki',1,NULL,'Modalidad de movimiento de suelo y siembra de manera paralela, se practica por lo general en los laymes o tierras de rotación siempre mediante el ayni. También conocido como labranza cero.',3,1),
	(93,93,'Yunta de Bueyes',1,NULL,'Empleado principalmente en la zona q’eswa, en terrenos de poca pendiente y de cierta profundidad; conformado por dos toros adiestrados, para el lado izquierdo y para el lado derecho unidos por un yugo.',3,1),
	(94,94,'T''aque',1,NULL,'almacén de la selección de semillas.',3,1),
	(95,95,'Challascca de ganado',2,NULL,'Rito de origen inca, consistía en rendir culto a los cerros, manantiales, la tierra y la alpaca con el propósito de lograr protección, bienestar y mayor producción de alpacas.',3,1),
	(96,96,'Hastanapata',2,NULL,'Práctica destinada a evitar el sobrepastoreo por la sobrecarga animal. En la época de lluvias los pastizales crecen más rápido por la humedad existente y se pastorea en la parte alta. En épocas de estiaje, los animales se pastorean en la parte baja.',3,1),
	(97,97,'Suertes',2,NULL,'Terrenos de rotación sectorial de cultivos, este tipo de rotación contribuyen a organizar mejor la agricultura pastoreo y la organización social de las familias de la comunidad.',3,1),
	(98,98,'Ayni',1,NULL,'Laboreo de las chacras en una modalidad de organización tradicional.',4,1),
	(99,99,'Tinkuy',7,NULL,'Ritual donde se pide permiso, a la Pachamama y a los Apus del lugar, ofrendándoseles coca Q’uintu y aguardiente o vino junto con invocaciones y oraciones, esta ceremonia generalmente este cargo de la familia propietaria de la chacra.',4,1),
	(100,100,'Chaquitaclla',1,NULL,'Herramienta para la labranza del suelo, haciendo uso de la fuerza del pie, el diseño varía en función del tipo de labranza, cuya variación principal se dan en la forma y longitud del timón o taclla.',4,1),
	(101,101,'Labranza wachu',1,NULL,'Es la labranza del primer surco a manera de ejemplo, determinando el ancho y profundidad del wachu o surco. La masa de la chaquitaclla esta formada por dos varones y una mujer. Los varones introducen la reja de la chaquitaclla y realizan un movimiento de palanca, en ese instante la mujer levanta la champa (prisma) del suelo, acción conocida como “rapay” y la coloca lateralmente sin separarla del suelo hacia el lado derecho e izquierdo simultáneamente, de manera que la cobertura vegetal del prisma se junta con la otra porción de suelo y así sucesivamente se continúa formando un característico surco.',4,1),
	(102,102,'Quncas',1,NULL,'Surcos tranversales.',4,1),
	(103,103,'Labranza T’aya',1,NULL,'Labranza en terrenos planos,siempre de la mano de la chaquitaclla, el grupo de ayni, donde la masa de chaquitaclla está conformado por un varón y una mujer, el primero introduce la reja y la mujer realiza el rapaq o volteo del prisma de suelo de manera simultánea, condición en que quedan durante varios meses, facilitando la meteorización del suelo.',4,1),
	(104,104,' Sistema Chuki',1,NULL,'Modalidad de movimiento de suelo y siembra de manera paralela, se practica por lo general en los laymes o tierras de rotación siempre mediante el ayni. También conocido como labranza cero; la masa de chaquitaclla la conforma uno o dos varones y una mujer quien deposita las semillas; el proceso consiste en introducir la reja de la herramienta y realizar un movimiento de palanca, para levantar el prisma del suelo, en ese momento la mujer introduce en el hoyo la semilla del tubérculo, junto al guano de corral e inmediatamente cubre el hoyo con su propio prisma.',4,1),
	(105,105,'Yunta de Bueyes',1,NULL,'Empleado principalmente en la zona q’eswa, en terrenos de poca pendiente y de cierta profundidad; conformado por dos toros adiestrados, para el lado izquierdo y para el lado derecho unidos por un yugo.',4,1),
	(106,106,'T''aque',1,NULL,'Almacén de la selección de semillas.',4,1),
	(107,107,'Muyuy',1,NULL,'Los muyuy son campos comunales de cierta extensión, algunas veces de 30 a 40 hectáreas, los cuales se siembran por períodos de tres a cuatro años con descansos prolongados de hasta diez años. La siembra y las labores culturales se efectúan en forma comunitaria y las decisiones sobre que especie se cultivarán y sobre los descansos también son de decisión comunal.',4,1),
	(108,108,'Suertes',1,NULL,'Rotación sectorial de cultivos en las que se crían variedades nativas de papas, esta sectorización la fueron hechas por los antiguos campesinos y obedece al dominio de muchos factores y criterios como de la fisiografía. Las suertes tienen un periodo de descanso de 5 años para recuperación de su fertilidad por lo que, las familias retornan a cultivar en dichas áreas cada cinco años, una vez que los suelos han recuperado su fertilidad.',4,1),
	(109,109,'Miska',1,NULL,'Siembra de variedades de papa nativa en el mes de mayo y la cosecha en los meses de noviembre y diciembre.',4,1),
	(110,110,'Maguay',1,NULL,'siembra de variedades de papa nativa en el mes de junio, la cosecha en el mes de diciembre y enero.',4,1),
	(111,111,'Loma tarpuy o siembra grande',1,NULL,'Siembra de variedades nativas de papa agosto y setiembre y la cosecha en los meses de mayo y junio.',4,1),
	(112,112,'Anapancu',1,6,'La buena floración de estas plantas en los meses de julio y agosto indica que es buen año agrícola.',4,1),
	(113,113,'Amapola (silvestre)',1,6,'La buena floración de esta planta en los meses junio y julio indica que es buen año agrícola.',4,1),
	(114,114,'Cactáceas',1,6,'La buena floración de estas plantas en los meses junio - agosto indica que es buen año agrícola.',4,1),
	(115,115,'Capulí',1,6,'La buena floración de estas plantas en el mes de agosto indica que habrá abundante cosecha y buen año agrícola.',4,1),
	(116,116,'Chihuanhuayta',1,6,'El tallo robusto y la buena floración de esta planta indica que será un buen año agrícola, si tiene buen desarrollo.',4,1),
	(117,117,'Chuntahuayta',1,6,'La floración abundante en esta planta en los meses de agosto y setiembre indica que es buen año agrícola.',4,1),
	(118,118,'Itapallo',1,6,'Si florece sin helarse en los meses de julio y agosto indica que es buen año agrícola.',4,1),
	(119,119,'Kallampa (hongo)',1,6,'Si emerge el tallo en el mes de diciembre indica que es buen año si produce en enero y febrero; mal año si se anticipa y lo hace en octubre.',4,1),
	(120,120,'Liquen',1,6,'Si la planta toma una coloración color negra en el mes de agosto indica que es buen año, si la coloración es gris esta sería un mal año.',4,1),
	(121,121,'Llutuyuyu',1,6,'El crecimiento abundante de estas plantas sobre las rocas en el mes de agosto indican que es un buen año.',4,1),
	(122,122,'Llachoc',1,6,'La abundancia de floración de estas plantas en el mes de agosto indican que es buen año; si se hiela en el mes de setiembre y noviembre anticipa heladas.',4,1),
	(123,123,'Mayhua',1,6,'La abundancia de floración de esta planta en el mes de setiembre anuncia lluvias atrasadas.',4,1),
	(124,124,'Molle',1,6,'La fructificación abundante de esta planta indica presencia de copiosas lluvias.',4,1),
	(125,125,'Matecllu',1,6,'La proliferación de estas plantas en las acequias en el mes de agosto-octubre indica mal año agrícola.',4,1),
	(126,126,'Trueque',8,NULL,'Intercambio de bienes materiales o servicios por otros objetos o servicios y se diferencia de la compraventa habitual en que no intermedia el dinero en la transacción. El contrato por el cual dos personas acceden ala trueque de denomina “permuta”, para existe le trueque debe existir exceso de bienes que no necesitan consumirse.',5,1),
	(127,127,'Ayni',8,NULL,'Es la base de las relaciones comunitarias que incentiva el “devolver lo que se ha recibido” y “recibir como devolución lo que se ha dado”.',5,1),
	(128,128,'Minka',8,NULL,'Consiste en una práctica en la que la comunidad se junta para trabajar en un objetivo en común como la construcción de una casa para una pareja joven que forma una nueva familia, levantar la cosecha de un grupo familiar o una obra de uso colectivo, con una devolución inmediata que puede ser, por ejemplo, una abundante comida o el compromiso de reciprocidad a futuro.',5,1),
	(129,129,'Cuasimodo',8,NULL,'Consiste en la Faena general de limpieza de caminos, carreteras, puentes, cementerios, etc, donde participan la población en general distribuyense tareas entre hombres y mujeres.',5,1),
	(130,130,'Fiesta de la siembra',1,NULL,'Consiste en escoger las mejores semillas para un nuevo ciclo en los cultivos se conoce entre indígenas como el Tarpuk Raymi o la Fiesta de la Siembra y se lo celebra en septiembre, cuando los agricultores, luego de cosechar en junio, guardan sus reservas.',5,1),
	(131,131,'Pagapus',3,NULL,'Es la ofrenda que se le hace a la Pachamama en un acto de renovación que consiste en devolver a la tierra lo que nos da, este ritual se realiza - por lo general - cuando es tiempo de cosecha para bendecir la siembra, se dice que es necesario ofrecerle los mejores alimentos para darle mayor fuerza y energía.',5,1),
	(132,132,'Hilado',3,NULL,'Consiste en el tratamiento de la lana de oveja o fibra de alpaca para los tejidos de frazadas, pullos, mantas de viaje, prendas de vestir medias, chompas, chalinas, etc.; utilizando como principal materia prima disponible; lana de alpaca y oveja, elaboran también monturas y frenos para el caballo, hecho con el cuero del ganado vacuno y ovino.',5,1),
	(133,133,'Almacenamiento de papa',1,NULL,'Los pobladores aún mantienen técnicas ancestrales, pues preparan en una esquina del ambiente de su vivienda destinada al almacenamiento de papa, una especie de nido poniendo en la base del suelo una capa de muña u eucalipto, luego colocan una capa de paja llegando a cobertura toda la superficie.',5,1),
	(134,134,'Medicina para enfermedades respiratorias',6,NULL,'Los pobladores preparan en un frasco de 500ml, 0.5 kg de miel, 2 onzas de cañazo, 5 g de propóleo; posteriormente esta infusión es dosificada en una cucharada, cada noche durante una semana, garantizando la cura de la enfermedad (tos, bronquios, etc.).',5,1),
	(135,135,'Shacta',5,NULL,'Se denomina así al plato que se sirve durante la traída, hasta hace muchos años atrás compuesta por carne charqui, queso, alverja tostada, choclos.',5,1),
	(136,136,'Shakatan',3,NULL,'Música y danza ancestral “El shakatan” tributo a los APU Nevados y Pakarinas, puquiales, el agradecimiento por los frutos recibidos. Se baila al compás de la tinya, wacra y cánticos de cantoras nativas.',5,1),
	(137,137,'Siembra en laymes',1,4,'Laymes son terrenos descansados de uso colectivo.',6,1),
	(138,138,'Chuño',1,4,'Elaboración de chuño a 4,800 - 5,000 m.s.n.m., en diez pasos:
