INSERT INTO tb_comunidad (id, numero_correlativo, nombre_comunidad, nombre_segun_sunarp, antecendente, altitud_min, altitud_max, altitud_inter, superficie_pe, ficha_registral, partida_electronica, folio_exp, pagina_exp, nom_predio, superficie_cat, superficie_comunidad_zabd, porcentaje_superficie_zabd, tb_zabd_id, availability, status) VALUES
	('1', '1', 'CC. Cojene-Rotojoni', 'Cojene-Rotojoni', 'La comunidad campesina Cojene-Rotojoni, ubicada en el Distrito de Cuyocuyo, Provincia de Sandia, Departamento de Puno. Colinda por el NORTE con la CC. Puna Ayllu y otros; por el ESTE con la CC. Huancasayani Cumani; por el SUR con la hacienda Limata y por el OESTE con la CC. Puna Ayllu.', '3350', '4100', '', '3747', '2426 - R', '05047635', '650', '', '', '3949.81', '849.15', '12.95', '1', '1', '1'),
	('2', '2', 'CC. Puna Ayllu', 'Puna Ayllu', 'La comunidad campesina Puna Ayllu, ubicada en el Distrito de Cuyocuyo, Provincia de Sandia, Departamento de Puno, fue reconocida el 20 de setiembre de 1956, mediante el “Decreto supremo Nº 008 del 10 de mayo de 1961 y su ampliatorio Nº 13 del 7 de julio de 1964; y estando a lo opinado por la Dirección General de Asuntos Indígenas, y de acuerdo con el Art. 207 de la Constitución del Estado". Colinda por NORTE con la CC. Puna Laqueque, Fundo Qupituyoc Choque Chambi y la CC. Ura Ayllu, iniciando el hito tripartito Palcca Punco, pasando por los hitos, Huacuyo, Uralakay Pata, Cocha Pampa Tranca, hasta llegar al hito Muña Cunca o Muña Cruz, lugar donde termina esta colindancia con una longitud de 5775 metros lineales; por el ESTE con la Comunidad Ura Ayllu y Cojene Rotojoni, iniciando en el hito Muña cunca o Muña cruz pasando por los hitos Kala Sencca, Cucho Cancha o Choco Choco, Cruz Esquina Huarachani, Cerro Condor Tuyonan, Amafrentina, Pcacca Pata o Darca Pata, Cerro Huiancha, huacallape, hasta llegar al hito tripartitito Yana Loma, con una longitud de 11075 metros lineales; por el SUR con el Fundo Culitira, con una longitud de 5380 metros lineales; por el OESTE con el terreno adjudicado a la CC. Puna Ayllu y el Fundo Versalles, con una longitud de 7320 metros lineales.', '3450', '4100', '', '3120', '5844', '05003351', '644, 657', '', '', '3148.78', '1008.42', '15.38', '1', '1', '1'),
	('3', '3', 'CC. Ura Ayllu', 'Ura Ayllu', 'La comunidad campesina Ura Ayllu, ubicada en el Distrito de Cuyocuyo, Provincia de Sandia, Departamento de Puno, fue reconocida el 15 de diciembre de 1963, mediante el “Decreto Supremo Nº 008 del 10 de mayo de 1961 y su ampliatorio Nº 13 del 7 de julio de 1964; y estando a lo opinado por la Dirección General de Asuntos Indígenas, y de acuerdo con el Art. 207 de la Constitución del Estado". Colindando por el NORTE con el fundo Qupituyoc-Choquechambi; por el ESTE con la CC. Ccapana; por el SUR con la CC. Huancasayani Cumani y por el OESTE con la CC. Puna Ayllu.', '3300', '4000', '', '2139.99', '2134 - R', '5047346', '646, 653', '', '', '2134.52', '1353.08', '20.64', '1', '1', '1'),
	('4', '4', 'CC. Huancasayani Cumani', 'Huancasayani Cumani', 'La comunidad campesina Huancasayani Cumani, ubicada en el Distrito de Cuyocuyo, Provincia de Sandia, Departamento de Puno, fue reconocida el 7 de setiembre de 1964, mediante "Decreto Supremo Nº 008 del 10 de mayo de 1961 y su ampliatorio Nº 13 del 7 de julio de 1964; y estando a lo opinado por la Dirección General de Asuntos Indígenas, y de acuerdo con el Art. 207 de la Constitución del Estado". Colinda por el NORTE con la CC. Ñacoreque, Aripo,Capuna; por el ESTE con la CC. Untuca y el grupo campesino Ccallpapata Lahua-Lauani; por el SUR con el grupo campesino Ccallpapata Lahua-Lauani y la CC. Pampa Cojone-Rotojani y por el OESTE con la CC Cojone-Rotojani, Ñacoreque.', '3250', '4150', '', '4494', '1410', '05046619', '642, 651', '', '', '4487.93', '1613.95', '24.62', '1', '1', '1'),
	('5', '5', 'CC. Ñacoreque', 'Ñacoreque', 'La comunidad campesina Ñacoreque, ubicada en el Distrito de Cuyocuyo, Provincia de Sandia, Departamento de Puno, fue reconocida el 7 setiembre de 1964 por el “Decreto supremo Nº 008 del 10 de mayo de 1961 y su ampliatorio Nº 13 del 7 de julio de 1964; y estando a lo opinado por la Dirección General de Asuntos Indígenas, y de acuerdo con el Art. 207 de la Constitución del Estado". Colinda por el NORTE con la comunidad Ura Ayllo; por el ESTE con la comunidad con la CC. Ura Ayllu; por el SUR con la CC. Cojene Rotojani y por el OESTE con la CC. Ura Ayllu.', '3050', '3950', '', '1421', '2334 - R', '05047545', '647, 648 - 655', '', '', '1440.71', '1351.14', '20.61', '1', '1', '1'),
	('6', '6', 'CC. Puna Laqueque', 'Puna Laqueque', 'La comunidad campesina Puna Laqueque, ubicada en el Distrito de Cuyocuyo, Provincia de Sandia, Departamento de Puno. Colinda por el NORTE con las comunidades campesinas (CC),  Puna Ayllu, Jarahuana y Laqueque Iguara llamani con una longitud de 16260 metros lineales ; Por el ESTE con el Fundo Qupituyoc Choquechambi, con la CC. Puna Ayllu, con el Fundo Versalles y con el Predio Sallaco Calzada Pata,  con una longitud de 19640 metros lineales ; Por el SUR con el Predio Jatun Estancia, CC. de Puna Ayllu, CC. Chuquine y con la CC. Chijos, sector Chijos Bajos, con una longitud de 11750 metros lineales y por el OESTE con el Fundo Huacchani adjudicado con 2896.82 ha otorgada mediante la reforma agraria a la comunidad campesina Puna Laqueque, con el predio Cunucachi con una longitud de 14400 metros lineales.', '3600', '4750', '', '4855', '8485 - 1706', '05051803', '622, 631, 649', '', '', '5054.47', '379.08', '5.78', '1', '1', '1'),
	('7', '1', 'CC. Amaru', 'Amaru', 'La comunidad campesina Amaru, ubicada en el Distrito de Pisac, Provincia de Calca, Departamento de Cuso, fue reconocida el 15 de febrero de 1965. Colindado por NORTE con las comunidades campesinas de Huama, Paru Paru y la C.A.P. San José Patriarca de Chahuaytire; por el ESTE colinda con las comunidades campesinas Sacaca y Kuyo Grande; por el SUR con las comunidades Maska Ccotobamba; por el OESTE con las comunidades de Viacha y Ccoya Ccoscco.', '', '', '3500', '1200.78', '', '02044696', '333 - 335', '', 'Terreno de la referida comunidad', '', '1200.78', '', '2', '1', '1'),
	('8', '2', 'CC. Chahuaytire', 'Chahuaytire', 'La comunidad de Chahuaytire ubicada en el Distrito de Pisac, Provincia de Calca, Departamento de Cuso. Colinda por el NORTE con la Comunidad Pampallacta, CC. checchemarca con 5340 metros lineales; por el ESTE colinda con la CC. Sipascancha Alta con una longitud de 8200 metros lineales; por el SUR colinda con el predio Zisacancha y el predio Puma Punco Anexo de Huallhua con 5360 metros lineales; por el OESTE colinda con la CC. Ccamahuara, Predio Perca área ocupada por la CC. Kuyo Grande, CC. kuyo Grande y CC. Sacaca con 9240 metros lineales.', '', '', '3650', '3301.22', '', '02019652', '325 - 329, 412', '', 'Chahuaytire', '', '3301.22', '', '2', '1', '1'),
	('9', '3', 'CC. Paru Paru', 'Paru Paru', 'La comunidad de Paru Paru, ubicada en el Distrito de Pisac, Provincia de Calca, Departamento de Cusco. Colinda por el NORTE con la comunidad campesina Paru Paru y comunidad campesina Pampallacta, con una longitud de 1310.00 metros lineales; por el ESTE colinda con la comunidad campesina Pampallacta con una longitud de 1300 metros lineales; por el SUR colinda con la comunidad campesina Pampallacta y predio Chahuaytire, adjudicado a la comunidad de Sacasaca, con una longitud de 1400 metros lineales; por el OESTE, colinda con la comunidad campesina Paru Paru, de por medio el riachuelo Llactumayo, con una longitud de 1950 metros lineales.', '', '', '4500', '1419.83', '13277', '02064760', '376 - 377, 411', '', 'Paru Paru', '', '1419.83', '', '2', '1', '1'),
	('10', '4', 'CC. Pampallacta', 'Pampallacta', 'La comunidad de Pampallacta, ubicada en el Distrito de Pisac, Provincia de Calca, Departamento de Cuso. Colinda por el NORTE con el ex predio Llocllapampa Adjudicada a la CC. Poqques con 3500 metros lineales; por el ESTE colinda con las comunidades campesinas Huarqui y Chiccellarca con 4100 metros lineales; por el SUR colinda con la CC. Bacaca con 5.300 metros lineales. Por el OESTE colinda con el área reivindicada a la CC. de Paru Paru con 5900 metros lineales.', '', '', '4050', '1316.5', '7516', '02066686', '374', '', 'Chahuaytire', '', '1316.5', '', '2', '1', '1'),
	('11', '1', 'CC. Ccollasuyo', 'Ccollasuyo', 'La comunidad campesina Ccollasuyo, Ubicada en el Distrito de Marcapata, Provincia de Quispicanchi, Departamento de Cusco, Colinda por NORTE con el rio Araza y el Sector Limacpunco, de la Comunidad Sahuancay; por el SUR con el Distrito de Pitumarca, Distrito de Corani (Puno) y Comunidad Huaracconi; por el ESTE con el anexo Racchi Pata de la CC. Marcapata Ccollana, Anexo Chilli Ccasa de la CC. Sahuancay, CC. Socapata, Predios Incacancha y Condena; por el OESTE con la Comunidad de Sahuancay.', '3400', '4500', '', '14780', '3010', '02078482', '', '75', 'Ccollasuyo', '', '14240.11', '', '3', '1', '1'),
	('12', '1', 'CC. Marcapata Ccollana', 'Marcapata Ccollana', 'La Comunidad Campesina Marcapata Ccollana pertenece al distrito de Marcapata, provincia de Quispicanchi, departamento del Cusco, colinda por el NORTE con la Comunidad Campesina Puyca Centro poblado Marcapata; por el SUR colinda con la comunidad campesina Canchis; por el ESTE con la comunidad campesina Sahuayccay; por el OESTE con la comunidad campesina Puyca.', '2800', '4500', '', '22767.42', '', '02000054', '', '206, 238', 'Marcapata Ccollana', '', '22679.59', '', '4', '1', '1'),
	('13', '1', 'CC. Lucma', 'Lucma', 'La comunidad campesina de Lucma, ubicada en el Distrito de Pariahuanca, Provincia de Huancayo, Departamento de Junín, Colinda por el NORTE con las comunidades de San Francisco de Llacsapirca y Chaquicocha con una longitud de 5,000.00 metros lineales; por el SUR colinda con la Comunidad de Ila con una longitud de 3,050.00 metros lineales; por el ESTE colinda con la comunidad de Lampa con una longitud de 4,060.00 metros lineales; por el OESTE colinda con tierras de la Comunidad de Palta Rumi con una longitud de 4,800.00 metros lineales.', '', '', '2660', '1090.625', '6453', '', '', '53, 185', 'CC. Lucma', '', '1090.625', '', '5', '1', '1'),
	('14', '2', 'CC. Lampa', 'Lampa', 'La comunidad campesina de Lampa, ubicada en el Distrito de Pariahuanca, Provincia de Huancayo, Departamento de Junín, Colinda por el NORTE con la comunidad de Surcubamba y Carmen Alto, con pequeños propietarios y con la comunidad de Otorongo con una longitud total de 7,700.00 ml; por el SUR colinda con la CAP Atahualpa con sus predios Chuyas y Huacuas con una longitud de 9,220.00 metros lineales; por el ESTE colinda con las Comunidades de Santa Rosa de Chaquicocha y Panti con una longitud de 8,180.00 metros lineales; por el OESTE colinda con las Comunidades de Chaquicocha, Lucma, Ila,  con una longitud de 19,120.00 metros lineales.', '', '', '2591', '8151.56', '', '02009954', '', '53, 182', 'CC. Lampa', '', '8151.56', '', '5', '1', '1'),
	('15', '3', 'CC. San Balvín', 'San Balvín', 'La comunidad campesina de San Balvín, ubicada en el Distrito de Pariahuanca, Provincia de Huancayo, Departamento de Junín, Colinda por el NORTE con el fundo Chuyas con una longitud de 2,100 metros lineales; por el SUR colinda con el predio Huari con una longitud de 1,300 metros lineales; por el ESTE colinda con la comunidad Antarpa Chico con una longitud de 3,775 metros lineales; por el OESTE colinda con el predio el Viejo Escarneo con una longitud de 2,425 metros lineales.', '', '', '2617', '408.6', '143', '11059795', '', '53, 203', 'CC. San Balvín', '', '408.6', '', '5', '1', '1'),
	('16', '4', 'CC. Chaquicocha', 'Chaquicocha', 'La comunidad campesina de Chaquicocha, ubicada en el Distrito de Pariahuanca, Provincia de Huancayo, Departamento de Junín, Colinda por el NORTE con la ex - hacienda Punto Callanca y con la Comunidad Campesina de Yanabamba en líneas sinuosas con una longitud total de 5,650.00 metros lineales; por el ESTE colinda con tierras de las Comunidades Campesinas de Surcubamba Carmen alto y Lampa en líneas sinuosas por las cumbres con una longitud de 15,100.00 metros lineales; por el SUR colinda con tierras de la Comunidad de Lucma por el Río de Pariahuanca con una longitud de 350.00 metros lineales;  por el OESTE Con tierra de las comunidades de Llacsapirca, Marancocho - Aychana y ex - hacienda Arma por el río Pariahuanca y en líneas sinuosas con una longitud total de 12,060.00 metros lineales.', '', '', '3742', '4241.81', '14646', '02007803', '', '53, 177 - 178', 'CC. Chaquicocha', '', '4241.81', '', '5', '1', '1'),
	('17', '5', 'CC. Panti', 'Panti', 'La comunidad campesina de Panti, ubicada en el Distrito de Pariahuanca, Provincia de Huancayo, Departamento de Junín, Colinda por el NORTE con la Comunidad Campesina de Chaquicocha y Manchay; por el SUR colinda con el río Pariahuanca y la Comunidad de Rocchac; por el ESTE colinda con las comunidades de Manchay, Santa Rosa de Cedruyo y Rochacc Chico; por el OESTE colinda con la comunidad Campesina de Lampa, la nueva esperanza y la libertad.', '', '', '2758', '5894.07', '', '02010121', '', '53, 188', 'CC. Panti', '', '5894.07', '', '5', '1', '1'),
	('18', '6', 'CC. Antarpa Chico', 'Antarpa Chico', 'La comunidad campesina de Antarpa Chico, ubicada en el Distrito de Pariahuanca, Provincia de Huancayo, Departamento de Junín, Colinda por el NORTE y ESTE con el Fundo Picpis con una longitud de 3,300.00 metros lineales; por el SUR colinda con tierras de Huari, Comunidad de Quimllo y el predio Antarpa Grande con una distancia de 4,590 metros lineales; por el OESTE con tierras de Antarpa Viejo con una longitud de 4,015 metros lineales.', '', '', '2417', '292.2', '26', '11059573', '', '53, 191 - 192', 'CC. Antarpa Chico', '', '292.2', '', '5', '1', '1'),
	('19', '7', 'CC. San Cristóbal de Picpis', 'San Cristóbal de Picpis', 'La comunidad campesina San Cristóbal de Picpis, ubicada en el Distrito de Pariahuanca, Provincia de Huancayo, Departamento de Junín, Colinda por el NORTE con terrenos del predio Chuyas con una distancia de 3,950 metros lineales; por el SUR colinda con la Comunidad Campesina Quimllo con una distancia total de 4,385 metros lineales; por el ESTE colinda con el lote 3 Picpis del Sr. Daniel Villanueva Onofre con una longitud total de 7,160 metros lineales;  por el SUR colinda con la Comunidad Campesina Quimllo con una longitud total de 4,385 metros lineales; por el OESTE colinda con el Predio Antarpa Chico con una longitud total de 7,010 metros lineales.', '', '', '1992', '902.2', '', '02012434', '', '53, 195 - 196', 'CC. San Cristóbal de Picpis', '', '902.2', '', '5', '1', '1'),
	('20', '8', 'CC. Paltarumi', 'Paltarumi', 'La comunidad campesina de Paltarumi, ubicada en el Distrito de Pariahuanca, Provincia de Huancayo, Departamento de Junín, Colinda por el NORTE con la Comunidad de Lucma con una longitud de 5,100 metros lineales; por el SUR colinda con terrenos de la ex Sais Cahuide con una longitud de 7,080.00 metros lineales; por el ESTE colinda con la Comunidad de Santa Rosa de Ila, con una longitud total de 7,700 metros lineales; por el OESTE colinda con terrenos de la ex Sais Cahuide con un tramo de 5,220 metros lineales.', '', '', '3472', '2155.6', '8152', '02003924', '', '53, 200', 'CC. Paltarumi', '', '2155.6', '', '5', '1', '1'),
	('21', '1', 'CC. Marjuni', 'Marjuni', 'La comunidad campesina Marjuni, ubicada en el Distrito de Lambrama, Provincia de Abancay, Departamento de Apurímac, fue reconocida el 18 de enero de 2000. Colindado por NORTE con la comunidad campesina de Payancca en una longitud de 8,600 metros lineales; por el ESTE colinda con la Dirección Regional Agraria Apurímac en una longitud de 20,680 metros lineales; por el SUR con la comunidad campesina de Lambrama en una longitud de 18,000 metros lineales; por el OESTE con la comunidad campesina de Pichiuca en una longitud de 2,050 metros lineales.', '', '', '', '8005', 'R-5622', '03000747', '', '', 'Marjuni', '', '8004.85', '56.13', '6', '1', '1'),
	('22', '2', 'CC. Kishuara', 'Kishuara', 'La comunidad campesina Kishuara, ubicada en el Distrito de Lambrama, Provincia de Abancay, Departamento de Apurímac, fue reconocida el 18 de noviembre de 1999. Colindado por NORTE con la comunidad campesina de Chua en una longitud de 6,260 metros lineales; por el ESTE colinda con la comunidad campesina de Marjuni en una longitud de 12,000 metros lineales; por el SUR con la comunidad campesina Pichiuca en una longitud de 4,400 metros lineales; por el OESTE con las comunidades campesinas de Santa Cruz de Paccaypata y Santa Isabel de Caype en una longitud de 5,160 y 7,880 metros lineales, respectivamente.', '', '', '', '3555', 'R-2054', '03018367', '32542', '', 'Kishuara', '', '3555', '24.93', '6', '1', '1'),
	('23', '3', 'CC. Payancca', 'Payancca', 'La comunidad campesina Payancca, ubicada en el Distrito de Lambrama, Provincia de Abancay, Departamento de Apurímac, fue reconocida el 27 de diciembre de 1999. Colindado por NORTE con la comunidad campesina de Chua en una longitud de 5,630 metros lineales; por el ESTE y SUR colinda con la comunidad campesina de Marjuni en una longitud de 13,680 metros; por el OESTE con la comunidad campesina de Kishuara en una longitud de 4,920 metros lineales.', '', '', '', '3518.75', 'R-2158', '03018443', '', '', 'Payancca', '', '2701.78', '18.94', '6', '1', '1');
